import React, { Component } from 'react';

class App extends Component {
	constructor() {

	}

	render() {
		return (
			<div>
				<h1>Hello!</h1>
				<p>My name is Meenal. I'm a Software Developer</p>
				<div>
					<p>My favorite language is Javascript</p>
				</div>
			</div>
		)
	}
}

export default App;
